  padding: 2rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;

let PlayerBox = styled.div`
  border-radius: 1rem;
  background: #b9848c;
  color: white;
  padding: 0.5rem;
  margin-top: 1rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;

let ContollerBtn = styled.button`
  margin-top: 1rem;
  border-radius: 10rem;
  background: #806491;
  margin-left: 0.5rem;
  margin-right: 1rem;
  border: none;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;

