  margin-top: 1rem;
  margin-bottom: 0rem;
  height: 3rem;
`;
let MusicBar1 = styled.div`
  background: white;
  width: 50rem;
  height: 0.5rem;
  margin: auto;
  margin-top: 3rem;
  // margin-bottom: 0.5rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;
let MusicBar2 = styled.div`
  background: red;
  width: 30rem;
  height: 0.5rem;
`;
let LoginBox = styled.div`
  background: #02315e;
  border-radius: 1rem;
  padding: 1rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
  float: right;
  color: white;
  margin-top: 1rem;
`;
let InputBox = styled.div`
  background: white;
  color: black;
  margin: 0.2rem;
  width: 10rem;
`;

let TimeLeft = styled.div`
  float: left;
  margin-top: 2rem;
